import React, { Component } from "react";
import Router from "@reach/router";

import Landing from "./containers/LandingPage/Landing.jsx";
import MonthlyDose from "./containers/MonthlyDosePage/MonthlyDose.jsx";

class Routes extends Component {
  render() {
    return (
      <Router>
        <Landing path="/" />
        <MonthlyDose path="/your-monthly-dose" />
      </Router>
    );
  }
}

export default Routes;
